import React from 'react';
import styled from 'styled-components';



const Title = styled.a`
  display: block;
  padding: 0.1em 8% 0.1em 5%; // 상하 패딩 0.1em, 좌우 패딩 20px/100px로 설정
  text-decoration: none;
  color: black;
  border: 1px solid transparent;  // 기본 상태에서도 테두리를 가지도록 변경
  box-sizing: border-box;  // 상자의 크기 계산 방법을 변경
  line-height: 2.5; // 글자 간의 간격 늘림
  
  font-family:'Apple SD Gothic Neo M', 'Noto Sans KR','Bagel Fat One',  sans-serif; // 폰트 설정
  font-size : 25px
  white-space: nowrap; // 자동 줄바꿈 방지
  `;

function HomeTitle(props) {
  return (
    <div>

      <Title href="#">{props.title}</Title>
    </div>
  );
}
export default HomeTitle;
